import React from "react";
import { Link } from "react-router-dom";
import "./styles.css";
export default function NavBar() {
  return (
    <nav className="navbar">
      <div>
        <Link to="/">
          <h3>Meu Blog</h3>
        </Link>
      </div>
      <div>
        <Link to="/">Home</Link>
        <Link to="/post">Sobre</Link>
        <Link to="/contact">Contato</Link>
        <Link to="/culture">Cultura</Link>
      </div>
    </nav>
  );
}
